import React from 'react'; 
// import Greating from './Greating';
import * as ques from './Cal';
 
function App(){

return <> 
 
<ul>

<li>sum{ ques.sum}</li>
<li>sub { ques.sub}</li>
<li>dev{ ques.dev}</li>
<li>mul { ques.mul}</li>
</ul>

</>;
 


}
export default App;
